import React, { useState } from 'react';

// Quiz questions data
const quizQuestions = [
  {
    question: "What is the capital of France?",
    options: ["London", "Berlin", "Paris", "Madrid"],
    correctAnswer: 2
  },
  {
    question: "Which planet is known as the Red Planet?",
    options: ["Venus", "Mars", "Jupiter", "Saturn"],
    correctAnswer: 1
  },
  {
    question: "What is 2 + 2?",
    options: ["3", "4", "5", "6"],
    correctAnswer: 1
  },
  {
    question: "Who painted the Mona Lisa?",
    options: ["Vincent van Gogh", "Pablo Picasso", "Leonardo da Vinci", "Michelangelo"],
    correctAnswer: 2
  },
  {
    question: "What is the largest ocean on Earth?",
    options: ["Atlantic Ocean", "Indian Ocean", "Arctic Ocean", "Pacific Ocean"],
    correctAnswer: 3
  },
  {
    question: "Which programming language is React built with?",
    options: ["Python", "JavaScript", "Java", "C++"],
    correctAnswer: 1
  },
  {
    question: "What year did World War II end?",
    options: ["1944", "1945", "1946", "1947"],
    correctAnswer: 1
  },
  {
    question: "Which element has the chemical symbol 'O'?",
    options: ["Gold", "Silver", "Oxygen", "Iron"],
    correctAnswer: 2
  }
];

function App() {
  // useState hooks as specified in requirements
  const [currentQuestionIndex, setCurrentQuestionIndex] = useState(0);
  const [selectedAnswer, setSelectedAnswer] = useState(null);
  const [totalScore, setTotalScore] = useState(0);
  const [showScore, setShowScore] = useState(false);

  const currentQuestion = quizQuestions[currentQuestionIndex];

  const handleAnswerClick = (selectedOptionIndex) => {
    setSelectedAnswer(selectedOptionIndex);

    // Check if the answer is correct and update score
    if (selectedOptionIndex === currentQuestion.correctAnswer) {
      setTotalScore(totalScore + 1);
    }

    // Move to next question after a short delay
    setTimeout(() => {
      const nextQuestionIndex = currentQuestionIndex + 1;
      
      if (nextQuestionIndex < quizQuestions.length) {
        setCurrentQuestionIndex(nextQuestionIndex);
        setSelectedAnswer(null);
      } else {
        setShowScore(true);
      }
    }, 500);
  };

  const restartQuiz = () => {
    setCurrentQuestionIndex(0);
    setSelectedAnswer(null);
    setTotalScore(0);
    setShowScore(false);
  };

  const getScorePercentage = () => {
    return Math.round((totalScore / quizQuestions.length) * 100);
  };

  const getScoreMessage = () => {
    const percentage = getScorePercentage();
    if (percentage >= 80) return "Excellent! ðŸŽ‰";
    if (percentage >= 60) return "Good job! ðŸ‘";
    if (percentage >= 40) return "Not bad! ðŸ‘Œ";
    return "Keep practicing! ðŸ’ª";
  };

  return (
    <div className="quiz-container">
      {showScore ? (
        <div className="score-section">
          <h1 className="score-title">Quiz Complete!</h1>
          <div className="score-text">
            You scored {totalScore} out of {quizQuestions.length}
          </div>
          <div className="score-percentage">
            {getScorePercentage()}% - {getScoreMessage()}
          </div>
          <button className="restart-button" onClick={restartQuiz}>
            Take Quiz Again
          </button>
        </div>
      ) : (
        <>
          <div className="quiz-header">
            <h1 className="quiz-title">Quiz App</h1>
            <div className="quiz-progress">
              Question {currentQuestionIndex + 1} of {quizQuestions.length}
            </div>
          </div>

          <div className="question-section">
            <div className="question-text">
              {currentQuestion.question}
            </div>
            
            <div className="answer-options">
              {currentQuestion.options.map((option, index) => (
                <button
                  key={index}
                  className="answer-button"
                  onClick={() => handleAnswerClick(index)}
                  disabled={selectedAnswer !== null}
                  style={{
                    backgroundColor: selectedAnswer === index 
                      ? (index === currentQuestion.correctAnswer ? '#d4edda' : '#f8d7da')
                      : '#f8f9fa'
                  }}
                >
                  {option}
                </button>
              ))}
            </div>
          </div>
        </>
      )}
    </div>
  );
}

export default App;
